<?php /*font customizer controls */

if( ! class_exists('WP_Customize_Control') ){
	return NULL;
}
class manang_Google_Font_Dropdown_Custom_Control extends WP_Customize_Control {
	private $fonts = false;
	public function __construct( $manager, $id, $args = array(), $options = array() ) {
	        $this->fonts = $this->get_fonts('all');
	        parent::__construct( $manager, $id, $args );
	    }

	/**
	 * Render the content of the category dropdown
	 *
	 * @return HTML
	 */
	public function render_content() {
	    if ( ! empty( $this->fonts ) ) {
	        sort($this->fonts);
	        ?>
	            <label>
	                <span class="customize-category-select-control"><?php echo esc_html( $this->label ); ?></span>
	                <select <?php $this->link(); ?> id="font-select">
	                	<?php echo '<option value="">Default</option>'; ?>
	                    <?php
	                        foreach ( $this->fonts as $k => $v ) {
	                            printf('<option value="%s" %s>%s</option>', $v->family, selected($this->value(), $k, false), $v->family);
	                        }
	                    ?>
	                </select>
	            </label>
	        <?php
	    }
	}

